import React from "react";
import "./home.css";
export default function home() {
  return (
    <div className="home p-12">
      <header className="w-full h-32 flex  justify-between ">
        {/* <h1 className="heading tracking-normal  ">
          <span className="text-transparent absolute left-0 right-0">a</span>
          MAGAZINE
        </h1> */}
        <div>
          <img src="./logo-2.jpeg" alt="" className="w-36 h-36" />
        </div>
        <div>
          <h1>MAGAZIN</h1>
        </div>
      </header>
    </div>
  );
}
